const initialState = {
    allDogs: [],
    copydogs:[],
    temperamento:[]
}

const reducer = (state= initialState, {type, payload})=>{
   // console.log("entro al reducer la informacion" + payload);
    switch( type ){
        default:
            return {...state}
    }




}

export default reducer;
